$(function(){$("#nav").tinyNav({header:"-- Navigation --"})});document.onreadystatechange=function(){document.readyState==="complete"&&$("ul.ww-nav ul.dropdown-menu").each(function(){parentWidth=$(this).parent().innerWidth();menuWidth=$(this).innerWidth();margin=parentWidth/2-menuWidth/2;margin=margin+"px";$(this).css("margin-left",margin)})};